  false,\n\t\"url\": null,\n\t\"notes\": \"LOCATION: Lat. 39 deg 39u2019 37u201dN,
  long. 93 deg 9u2019 9u201dW, 23 miles east southeast of Chillicothe, MO, Charlton
  County. Gage is on the right bank, 75 feet south of bridge abutment near Fulbright
  Road crossing.DRAINAGE AREA: 48.9 square miles SURFACE WATER RECORDS PERIOD OF RECORD:
  April 29, 2010 to present. GAGE SITE: Sutron Monitor 1 in metal gage housing in
  communication with a KPSI submersible pressure transducer mounted on a fencepost
  in the streambed under the bridge. Instruments are powered by a solar panel run
  to a battery inside the gage housing. Stage data are collected at 15 minute intervals.
  NATIONAL WILDLIFE REFUGE: Swan Lake NWR REMARKS: Records coded FAIR for 2010 calendar
